import './App.css';

function App() {
  return (
    <div className="App">
      <div class="cover-photo">Cover Photo</div>
      <div class="title">Science, Technology and the SuperHuman Obsession</div>
      <div class="intro">
        <p>The year is 1960, blablablabla introduce exhibit</p>
        <p>Talk about more stuff</p>
      </div>
      <div class="source-container">This is where all the sources will be contained</div>
    </div>
  );
}

export default App;
